import { Box } from "@mui/system";
import { Header } from "./components/Header";
import { Home } from "./pages/Home";


const App = ()  => {
  return (
    < div style={{m:0,p:0}}>
      <Header/>
      <Box display="flex"
                     justifyContent="center"
                     alignItems="center"
                     ><Home/></Box>
    </div>
  );
}

export default App;
